LONG_DESCRIPTION:
Moradia isolada T3 em Bustos

Rc composto por 2 quartos, wc, sala e cozinha. Cozinha com armários e equipada com exaustor e esquentador. Sala com recuperador de calor;

1º andar composto por suite (quarto com wc) e  arrumos;

Anexos com  salão, wc, garagem e churrasqueira ;

Trata se de uma moradia isolada com duas entradas, uma de cada lado e com jardim na frente;

Aquecimento central efetuado por recuperador de calor, com apoio de radiadores;

Áreas: terreno 360m2 , implementação 222 m2, Construção 185m2, dependente 37m2, privativa 147m2;
Valor: 150.000,00 euros

